            <h3 class=""medium_heading""> II. PEDAGOGICAL OBJECTIVES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origin of the program </h3>
                <p class=""description""> 
                    Civil engineering represents all civil construction techniques. Civil engineers are responsible for the design, the construction, operation and
                    rehabilitation of construction works and the infrastructure they manage to meet the needs of society, while ensuring the safety of the public and
                    the protection of the environment. Their work is very varied and is mainly divided into five main areas of intervention : structures, geotechnical,
                    hydraulic, transport and environment.
                </p>
    ");
            WriteLiteral(@"        </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectives of the program </h3>
                <h3 class=""smaller_heading""> II.2.1. General Objectives </h3>
                <p class=""description""> 
                    The Civil Engineering Riads & Constructions aims to give students a scientific and technical culture to master the technologies and their
                    evolutions, especially in the construction works. This knowledge links engineering with the humanities and economics. The course focuses on
                    knowledge of materials, fluids and structures in a production, maintenance or management perspective. They also develop project planning and
                    management tools. The specializations of this distinction share objectives for the training of students both in the field of research and towards
                    professional applications.
                </p>

                <h3 class=""smaller_headi");
            WriteLiteral(@"ng""> II.2.2. Spécific Objectives </h3>
                <p class=""description""> 
                    <strong> Commun run to the mention </strong><br/>
                    The course is based on a solid base of scientific and technical knowledge and practices that allow to master the methods of dimensioning the
                    structures and equipment of the buildings by respecting the regulations in force, drafting the corresponding documents and executing the plans.
                    The course includes an end study project and a work placement in order to better prepare for occupational integration. It develops the spirit of
                    technological watch and adaptability. It is also open to international exchanges.
                </p>

                <h3 class=""small_heading""> II.3. Program approach </h3>
                <p class=""description""> 
                    The Roads and Constructions Engineering course is one of the three courses of BIIM Master in Civil Engineering and p");
            WriteLiteral(@"repares students for
                    engineering professions in the Roads and Constructions. It provides all the necessary skills for the design and execution of civil engineering
                    works while introducing students to the fields of research and innovation. The two-year course covers all major aspects of civil engineering. It is
                    based on a solid foundation of scientific and technical teaching aimed at scientific and technical autonomy and open-mindedness.
                    It prepares people for professional life through professional seminars, site visits, projects, meetings with companies and internships. It also
                    provides an excellent introduction to research by a research internship thus preparing for the continuation of doctoral studies.
                    <br/> The M1 in Civil Engineering Roads and Constructions is common to the three concentrations of the second year (M2) :
                </p>
                <ul class=""one_list"">
");
